import React from 'react';

function Textbox() {
    state = {
        task: ""
    }

    onSubmit = () => {
        console.log(this.state.task);


    }

    return (
        <div className = "entry">
            <input
                type = "text"
                placeholder = "Input"
                value = {this.state.task}
                onChange = {e => this.setState({
                    task: e.target.value
                })}
            />
            <button 
                className = "inputButton"
                type = "submit" 
                onClick = {() => this.onSubmit()}
            >
                <i> Submit</i>
            </button>
        </div>
    );
}
export default Textbox;
